// Codon position nucleotide frequencies
// Order: A=0, C=1, G=2, T=3
constexpr float VERTEBRATE_OTHER_CODON_POS0_NT_FREQ[4] = {
    0.282354f, 0.236980f, 0.313014f, 0.167652f
};

constexpr float VERTEBRATE_OTHER_CODON_POS1_NT_FREQ[4] = {
    0.324689f, 0.235832f, 0.184680f, 0.254798f
};

constexpr float VERTEBRATE_OTHER_CODON_POS2_NT_FREQ[4] = {
    0.203013f, 0.288331f, 0.285972f, 0.222684f
};

// GC content by codon position
constexpr float VERTEBRATE_OTHER_GC1 = 0.549994f;
constexpr float VERTEBRATE_OTHER_GC2 = 0.420513f;
constexpr float VERTEBRATE_OTHER_GC3 = 0.574304f;  // Wobble position

/**
 * Calculate frame score using dicodon phase hexamers
 * 
 * @param seq DNA sequence
 * @param frame Reading frame (0, 1, or 2)
 * @return Log-likelihood ratio score (higher = more likely this frame)
 */
inline float calculate_vertebrate_other_frame_score(const char* seq, size_t len, int frame) {
    if (len < 6 || frame < 0 || frame > 2) return 0.0f;
    
    float llr_sum = 0.0f;
    int count = 0;
    constexpr float UNIFORM = 1.0f / 4096.0f;
    
    extern uint32_t encode_hexamer(const char*);
    
    // Score each hexamer position
    for (size_t i = 0; i + 5 < len; i++) {
        uint32_t code = encode_hexamer(seq + i);
        if (code >= 4096) continue;
        
        // What phase would this position be in if we're in 'frame'?
        // phase = (i - frame + 300) % 3
        int phase = (static_cast<int>(i) - frame + 300) % 3;
        
        float freq;
        switch (phase) {
            case 0: freq = VERTEBRATE_OTHER_PHASE0_HEXAMER_FREQ[code]; break;
            case 1: freq = VERTEBRATE_OTHER_PHASE1_HEXAMER_FREQ[code]; break;
            case 2: freq = VERTEBRATE_OTHER_PHASE2_HEXAMER_FREQ[code]; break;
            default: freq = UNIFORM;
        }
        
        if (freq > 1e-10f) {
            llr_sum += std::log(freq / UNIFORM);
            count++;
        }
    }
    
    return count > 0 ? llr_sum / count : 0.0f;
}

/**
 * Select best frame using dicodon phase analysis
 * 
 * @param seq DNA sequence
 * @param len Sequence length
 * @return Best frame (0, 1, or 2) and score difference from second best
 */
inline std::pair<int, float> select_vertebrate_other_best_frame(const char* seq, size_t len) {
    float scores[3];
    scores[0] = calculate_vertebrate_other_frame_score(seq, len, 0);
    scores[1] = calculate_vertebrate_other_frame_score(seq, len, 1);
    scores[2] = calculate_vertebrate_other_frame_score(seq, len, 2);
    
    int best = 0;
    if (scores[1] > scores[best]) best = 1;
    if (scores[2] > scores[best]) best = 2;
    
    // Find second best for confidence calculation
    float second_best = (best == 0) ? scores[1] : scores[0];
    for (int i = 0; i < 3; i++) {
        if (i != best && scores[i] > second_best) second_best = scores[i];
    }
    
    return {best, scores[best] - second_best};
}

